                    boundary[2] = i
                if boundary[3] < i or boundary[3] == -1:
                    boundary[3] = i
    min_cost_rectangle = []
    for i in range(boundary[2], boundary[3] + 1):
        min_cost_rectangle.append(''.join(data[i][boundary[0]:boundary[1] + 1]))
    return min_cost_rectangle

